import React,{Fragment} from 'react';


const titleBlog = [
	{border: <div className="bg-info card-border" />, title: nbContrats, subtitle: 'Total des Contrats', icon: <Icon4 />,},
	{border: <div className="bg-warning card-border" />, title: nbClients, subtitle: 'Total des Clients', icon: <Icon2 />,},
	{border: <div className="bg-primary card-border" />, title: nbVoitures, subtitle: 'Total des Voitures', icon: <Icon3 />,},
	{border: <div className="bg-secondary card-border" />, title: nbAvancemens, subtitle: 'Total des Avancements', icon: <Icon1 />,},
];




const Index = () =>{
	return(
		<Fragment>
			<div className="row">
				{titleBlog.map((item,index)=>(
					<div className="col-xl-3 col-xxl-6 col-lg-6 col-sm-6" key={index}>
						<div className="card card-bd">
							{item.border}
							<div className="card-body">
								<div className="media align-items-center">
									<div className="media-body mr-3">
										<h2 className="num-text text-black font-w700">{item.title}</h2>
										<span className="fs-14">{item.subtitle}</span>
									</div>
									{item.icon}
								</div>
							</div>
						</div>
					</div>
				))}
			</div>		
		</Fragment>
		
	)
}
export default Index;
